package edu.mit.appinventor.deeplearn;

import android.util.Base64InputStream;
import android.util.Log;
import android.webkit.JavascriptInterface;
import android.webkit.ValueCallback;
import android.webkit.WebView;
import com.google.appinventor.components.annotations.DesignerComponent;
import com.google.appinventor.components.annotations.SimpleEvent;
import com.google.appinventor.components.annotations.SimpleFunction;
import com.google.appinventor.components.annotations.SimpleObject;
import com.google.appinventor.components.common.ComponentCategory;
import com.google.appinventor.components.runtime.AndroidNonvisibleComponent;
import com.google.appinventor.components.runtime.EventDispatcher;
import com.google.appinventor.components.runtime.Form;
import com.google.appinventor.components.runtime.util.JsonUtil;
import com.google.appinventor.components.runtime.util.YailList;
import org.json.JSONException;
import org.json.JSONObject;

import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.io.InputStream;
import java.util.Arrays;
import java.util.Iterator;
import java.util.zip.GZIPInputStream;

@DesignerComponent(category = ComponentCategory.EXTENSION,
    nonVisible = true,
    version = 1)
@SimpleObject(external = true)
public class DeepLearnJS extends AndroidNonvisibleComponent {
  private static final String LOG_TAG = DeepLearnJS.class.getSimpleName();

  private static final String[] DL_JS = {
      "",
      "",
      "",
      "",
      "",
      "",
      "",
      ""
  };
  private static final String[] DL_SQUEEZE_JS = {
      "",
      "",
      "",
      "",
      "",
      "",
      "",
      "",
      ""
  };
  private static final String TEST_JS = "";
  private static final String EVAN_TEST = "H4sICE/9IFoAA3Rlc3QuanMAJY1BCsIwEEX3OcWQTROQHsDiQnAhRRSsFwhlWoPJJEySgpTe3bZuP++9PxTqsw0EffCxZDy/3pZGNRlXUMMsACbDwJiKy3CCWZLxKI+wAweQHlMy47bIKzoX5NKszgUx3tAwtV3NGAPn515Qbfe41ynz+mGHr/p3td4cxlyYoAqfqhGL+AFEMVK5mQAAAA==";
  private static final String EVAN_TEST2 =
      "function computeAThing(x) {" +
          "var result = {'name': x, 'message': 'Hello'};" +
          "DeepLearnJS.reportResult(JSON.stringify(result));" +
          "return 'ok';" +
          "}";
  private WebView webView;
  private Iterator<String> scriptsToLoad;

  private class JsObject {
    @JavascriptInterface
    public void reportResult(String result) {
      try {
        JSONObject object = new JSONObject(result);
        final YailList resultList = YailList.makeList(JsonUtil.getListFromJsonObject(object));
        form.runOnUiThread(new Runnable() {
          @Override
          public void run() {
            // TODO: Swap out this call for Classified(YailList)
            ComputedAThing(resultList);
          }
        });
      } catch(JSONException e) {
        e.printStackTrace();
        reportError(1, e.getMessage());
      }
    }

    @JavascriptInterface
    public void reportError(final int code, final String message) {
      form.runOnUiThread(new Runnable() {
        @Override
        public void run() {
          ClassificationFailed(code, message);
        }
      });
    }
  }

  /**
   * Creates a new AndroidNonvisibleComponent.
   *
   * @param form the container that this component will be placed in
   */
  public DeepLearnJS(Form form) {
    super(form);
    webView = new WebView(form);
    webView.getSettings().setJavaScriptEnabled(true);
    webView.addJavascriptInterface(new JsObject(), "DeepLearnJS");
    scriptsToLoad = Arrays.asList(EVAN_TEST).iterator();
    loadNextScript();
  }

  @SimpleFunction
  public void Classify(String image) {
    // load the image using MediaUtils and then process it in the webview
  }

  @SimpleFunction
  public void ComputeAThing(String input) {
    try {
      webView.evaluateJavascript("try { computeAThing(" + JsonUtil.getJsonRepresentation(input) + ") } catch(e) { DeepLearnJS.reportError(4, e.toString()); }", new ValueCallback<String>() {
        @Override
        public void onReceiveValue(String s) {
          Log.d(LOG_TAG, "Test result = " + s);
        }
      });
    } catch(JSONException e) {
      e.printStackTrace();
      ClassificationFailed(2, e.getMessage());
    }
  }

  @SimpleEvent
  public void Ready() {
    EventDispatcher.dispatchEvent(this, "Ready");
  }

  @SimpleEvent
  public void Classified(YailList result) {
    EventDispatcher.dispatchEvent(this, "Classified", result);
  }

  @SimpleEvent
  public void ClassificationFailed(int errorCode, String message) {
    EventDispatcher.dispatchEvent(this, "ClassificationFailed", errorCode, message);
  }

  @SimpleEvent
  public void ComputedAThing(YailList result) {
    EventDispatcher.dispatchEvent(this, "ComputedAThing", result);
  }

  private void loadNextScript() {
    if (scriptsToLoad.hasNext()) {
      try {
        load(scriptsToLoad.next());
      } catch (IOException e) {
        e.printStackTrace();
      }
    } else {
      form.runOnUiThread(new Runnable() {
        @Override
        public void run() {
          Ready();
        }
      });
    }
  }

  private void load(String content) throws IOException {
    byte[] javascriptBytes = new byte[1024*1024];
    int read;
    InputStream is = null;
    try {
      is = new GZIPInputStream(new Base64InputStream(new ByteArrayInputStream(content.getBytes("UTF-8")), 0));
      content = null;
      if ((read = is.read(javascriptBytes)) <= 0) {
        throw new IOException("Couldn't read the whole thing");
      }
    } finally {
      if (is != null) {
        try {
          is.close();
        } catch (IOException e) {
          // don't care
        }
      }
    }
    String javascript = new String(javascriptBytes, 0, read, "UTF-8");
    javascriptBytes = null;
    Log.d(LOG_TAG, "Going to eval = \n" + javascript);
    webView.evaluateJavascript(javascript, new ValueCallback<String>() {
      @Override
      public void onReceiveValue(String s) {
        loadNextScript();
      }
    });
  }
}
